import './ToggleSwitch.css'
function ToggleSwitch(){
    return(
        <div className='toggle'>
             <label className='switch'>
            <input type='ckeckbox'/>
            <span className='sliderRound'></span>
            </label>
        </div>
    )
}
export default ToggleSwitch
